import '../assets/css/App.css';
import { motion } from 'framer-motion/dist/framer-motion';

function Rarity() {

return (

    <motion.div
  initial={{ opacity: 0 }}
  animate={{ opacity: 1 }}
  exit={{ opacity: 0 }}
  >
        <h1>Rarity page</h1>
    </motion.div>

);


}


export default Rarity;
